import React from "react";
import Card from "./Card";
import CardData from "./CardD.jsx";


const Services = ()=>{

    console.log(CardData)
    return(<>
      {CardData.map((val,index)=>{
        return <Card
            title={val.Title}
            Description={val.Desc}
            >


        </Card>
      })}
    </>)
}


export default Services;
